import React from 'react';

import { AppRouterLink } from '../../../UI/AppRouterLink'
import { AppPercentIcon } from '../../../UI/Icons/AppPercentIcon'


export const HeaderMainNav = () => {
  const navLinksData = [
    { name: 'Акции', href: '/stock' }
  ]

  return (
    <div className="container">
      <div className="row">
        <nav>
          { navLinksData.map((linkData, id) => (
            <AppRouterLink href={ linkData.href } key={ id } className="d-flex justify-content-column">
              <AppPercentIcon />
              { linkData.name }
            </AppRouterLink>
          )) }
        </nav>
      </div>
    </div>
  )
}
